const personajes = ['Goku', 'Vegeta', 'Trunks'];

const [ ps1, ps2, ps3 ] = personajes;

console.log(ps1);
console.log(ps2);
console.log(ps3);

const retornaArreglo = () => {
    return ['ABC', 123];
}

const arr = retornaArreglo();
console.log(arr);
